import React, { useState } from "react";

const TestList = () => {
  let [list, listChange] = useState([
    { id: 1, name: "A", age: 1 },
    { id: 2, name: "B", age: 2 },
    { id: 3, name: "C", age: 3 },
  ]);

  return (
    <div>
      <div className="container-lg" style={{ marginTop: "100px" }}>
        <div className="row">
          {list.map((item, index) => {
            return (
              <div className="col" key={index}>
                <p>{item.name}</p>
                <p>{item.age}</p>
              </div>
            );
          })}
        </div>
      </div>
    </div>
  );
};

export default TestList;
